import React from 'react';
import "./style.scss";

const NotFound = () => {
    return (
        <div className="flex flex-col h-screen items-center">
            <div className="relative">
                <img className="w-full" src="https://cdn.svgator.com/images/2022/01/funny-404-error-page-design.gif" alt='404 Not Found' />
                <h1 className="text-5xl text-blueTemplate font-bold left-50 absolute translate-y-1/2 translate-x-1/2 bottom-20 right-1/2">404 Not Found</h1>
                <p className="text-lg italic absolute translate-y-1/2 translate-x-1/2 left-50 bottom-0 right-auto">Đường dẫn bạn truy cập có thể bị sai, hoặc đã gỡ trên trang Oupia</p>
            </div>
        </div>
    );
};

export default NotFound;
